BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "AudioMessages" (
	"id"	INTEGER,
	"start_time"	DATETIME,
	"ip_address"	TEXT,
	"file_path"	TEXT,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "Local" (
	"id"	INTEGER,
	"type"	TEXT,
	"name"	TEXT,
	"mainRoipId"	INTEGER,
	"secundaryRoipId"	INTEGER,
	FOREIGN KEY("mainRoipId") REFERENCES "Roip"("id"),
	FOREIGN KEY("secundaryRoipId") REFERENCES "Roip"("id"),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "Roip" (
	"id"	INTEGER,
	"name"	TEXT,
	"ip"	TEXT,
	"mac"	TEXT,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "User" (
	"id"	INTEGER,
	"name"	TEXT,
	"password"	TEXT,
	"function"	TEXT,
	"localId"	INTEGER,
	FOREIGN KEY("localId") REFERENCES "Local"("id"),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "DashboardConfig" (
	"id"	INTEGER,
	"operatorId"	INTEGER,
	"localAId"	INTEGER,
	"localBId"	INTEGER,
	FOREIGN KEY("localAId") REFERENCES "Local"("id"),
	FOREIGN KEY("localBId") REFERENCES "Local"("id"),
	FOREIGN KEY("operatorId") REFERENCES "User"("id"),
	PRIMARY KEY("id")
);
COMMIT;
